import React from 'react'

function Searchbox() {
  return (
    <div id='search' className='search'>
      <input type='text' className='input' placeholder='Search...'></input>
      <button className='reset'>
        <div className='handle'></div>
      </button>

    </div>
  )
}

export default Searchbox
